import{_ as e,o as r,c as t,O as a}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 58.1-1037 Seizure.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/58.1-1037.md","filePath":"vacode/58.1-1037.md"}'),i={name:"vacode/58.1-1037.md"},o=a('<h1 id="§-58-1-1037-seizure" tabindex="-1">§ 58.1-1037 Seizure. <a class="header-anchor" href="#§-58-1-1037-seizure" aria-label="Permalink to &quot;§ 58.1-1037 Seizure.&quot;">​</a></h1><p>Cigarettes that are acquired, held, owned, possessed, transported in, imported into, or sold or distributed in the Commonwealth in violation of this chapter shall be deemed contraband and shall be subject to seizure, forfeiture, destruction, or court-ordered assignment for use by a law-enforcement undercover operation. Such cigarettes shall be deemed contraband whether or not the violation of this chapter is with knowledge.</p><p>2000, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0880" target="_blank" rel="noreferrer">880</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0901" target="_blank" rel="noreferrer">901</a>; 2012, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0362" target="_blank" rel="noreferrer">362</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0472" target="_blank" rel="noreferrer">472</a>.</p>',3),n=[o];function s(l,c,d,h,_,p){return r(),t("div",null,n)}const g=e(i,[["render",s]]);export{u as __pageData,g as default};
